import SideBarStyle from '../Style/SideBar.module.css'

const SideBar = () => {
    return (
        <div className={SideBarStyle.SideBarMain}>
            <button className={`${SideBarStyle.btn} ${SideBarStyle.btnTop}`} type='button'>1</button>
            <div></div>
            Cappuccino
            Latte
            Americano
            Expresso
            Flat White
            <button className={`${SideBarStyle.btn} ${SideBarStyle.btnBottom}`}></button>
        </div>
    )
}
export default SideBar;
